import $ from 'jquery';
import axios from 'axios'

export default class ChangeTheme extends Component {
    
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div>
                <div className='themechange bg-white'>
                    <div className="row">
                        <div className="col-md-2 col-sm-2 col-xs-2 testbgcolor" style={{backgroundColor: localStorage.getItem('bgColor')}}>

                        </div>
                        <div className="col-md-2 col-sm-2 col-xs-2">
                        <div class="form-group">
                                <label for="inputName" class="col-md-3 control-label">
                                    Username:</label>
                                <div class="col-md-9">
                                    <div class="input-icon left">
                                        <i class="fa fa-user"></i>
                                        <input id="inputName" type="text" placeholder="" class="form-control" />
                                        <span class="text-danger msgu"></span></div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
